import React from "react";
import "./header.modul.css";

import { createUseStyles } from "react-jss";

// =================================================================
const useStyles = createUseStyles({
  Header: {
    padding: "2rem 10rem",
    fontSize: "1.6rem",
    backgroundColor: " #1d1d26",
  },
  header__logo: {
    textTransform: "uppercase",
    fontSize: "3rem",
    fontWeight: "700",
  },

  header__button: {
    "&:not(:lastchild)": {
      marginRight: "2rem",
    },
  },
});

export default function Header() {
  const classes = useStyles();

  return (
    <div className={classes.Header + ` position-fixed w-100 t-0 d-flex align-items-center justify-content-between `}>
      <a className={classes.header__logo} href="http://">
        todo
      </a>
      <div className="header__buttons d-flex align-items-center">
        <button
          href=""
          className="{classes} button btn--none-border btn--hover-bb mb-0"
          style={{ marginRight: "2rem" }}
        >
          Sign in
        </button>
        <button
          href=""
          className="header__button button btn--border btn--hover-border mb-0"
        >
          Sign up
        </button>
      </div>
    </div>
  );
}
